import React from 'react';
import './styles/Header.css';

function Header() {
  return (
    <header className="header">
    
      <h1>Deepak Raj</h1>
      <p className="tags"> <b>Developer</b> || <b>Traveller</b></p>
    </header>
  );
}

export default Header;
